import React, { Component } from 'react'

import './login.css'

class Login extends Component {
    render() {
        return (
            <div class='outer'>
                <div class='inner'>
                    <h1>Login</h1>
                    <form>
                        <p>Email Address</p>
                        <input type='text'/>
                        <p>Password</p>
                        <input type='text'/>
                    </form>
                </div>
            </div>
        );
    }
}

export default Login
